import React from 'react';

const Card = () => {
    return (

        <div className="container card mt-xl-3 pb-2">
            <div className="row">
                <div className = "col-xl-9 col-6">
                    <h1 style={{color: 'black'}}>Sorting methods in .NET 8</h1>
                </div>
                <div className = "col-xl-3 col-6 text-xl-end mt-xl-3">
                    <h4 style={{color: 'black'}}>Tuesday, 14 November</h4>
                </div>
                <div className = "col-xl-6 col-6">
                    <img src="https://imagess.hb.ru-msk.vkcs.cloud/maxresdefault.jpg" className="rounded" width="100%" alt="Image"/>
                </div>
            </div>
        </div>
    );
};

export default Card;
